window.initMap=function(){const e={lat:31.7767,lng:35.2345},o=new google.maps.Map(document.getElementById("google-map"),{zoom:13,center:e,mapTypeId:"terrain"});new google.maps.Marker({position:e,map:o,title:"Jerusalem"})},"serviceWorker"in navigator&&window.addEventListener("load",function(){navigator.serviceWorker.register("/service-worker.js").then(function(e){console.log("Service Worker registered with scope: ",e.scope)}).catch(function(e){console.log("Service Worker registration failed: ",e)})});